// SPDX-License-Identifier: GPL-2.0-or-later
pragma solidity =0.7.6;
pragma abicoder v2;

import "@uniswap/v3-periphery/contracts/interfaces/ISwapRouter.sol";
import "@uniswap/v3-periphery/contracts/libraries/TransferHelper.sol";
import "@uniswap/v3-periphery/contracts/interfaces/external/IWETH9.sol";
import "@chainlink/contracts/src/v0.7/interfaces/AggregatorV3Interface.sol";
import "hardhat/console.sol";

interface ERC20Swapper {
    /// @dev swaps the `msg.value` Ether to at least `minAmount` of tokens in `address`, or reverts
    /// @param token The address of ERC-20 token to swap
    /// @param minAmount The minimum amount of tokens transferred to msg.sender
    function swapEtherToToken(
        address token,
        uint minAmount
    ) external payable returns (uint);
}

contract UniswapV3ERC20SwapperV2 is ERC20Swapper {
    ISwapRouter public immutable swapRouter;
    address public immutable WETH9;
    uint24 public constant poolFee = 3000;

    uint256 private constant SLIPPAGE_TOLERANCE_BP = 500; // 5% slippage tolerance

    AggregatorV3Interface internal priceFeed;

    constructor(
        ISwapRouter _swapRouter,
        address _wethAddress,
        address _priceFeed
    ) {
        swapRouter = _swapRouter;
        WETH9 = _wethAddress;
        priceFeed = AggregatorV3Interface(_priceFeed);
    }

    function swapEtherToToken(
        address token,
        uint minAmount
    ) public payable override returns (uint amountOut) {
        uint amountToswap = msg.value;
        uint maxSpendAmount = getMaxSpendAmount(amountToswap);
        console.log(minAmount);
        console.log(maxSpendAmount);
        amountOut = _swapEtherToToken(token, minAmount, maxSpendAmount);
    }

    function _swapEtherToToken(
        address token,
        uint minAmount,
        uint maxSpendAmount
    ) private returns (uint256) {
        ISwapRouter.ExactInputSingleParams memory params = ISwapRouter
            .ExactInputSingleParams({
                tokenIn: WETH9,
                tokenOut: token,
                fee: poolFee,
                recipient: msg.sender,
                deadline: block.timestamp,
                amountIn: maxSpendAmount,
                amountOutMinimum: minAmount,
                sqrtPriceLimitX96: 0 // TODO: check this out
            });
        // Execute swap
        uint256 amountOut = swapRouter.exactInputSingle{value: maxSpendAmount}(
            params
        );

        return amountOut;
    }

    function getMaxSpendAmount(
        uint amountToSwap
    ) private view returns (uint256) {
        (, int256 price, , , ) = priceFeed.latestRoundData();
        uint8 decimals = priceFeed.decimals();
        // Calculate maximum spend amount based on current ETH price and slippage tolerance
        uint256 maxSpendAmount = (amountToSwap *
            (uint256(price) / 10 ** uint256(decimals)) *
            (10000 - SLIPPAGE_TOLERANCE_BP)) / 10000;
        // uint256 maxSpendAmount = amountToSwap *
        //     (uint256(price) / 10 ** uint256(decimals));
        return maxSpendAmount;
    }
}

